function Connexion() {





    return (
        <>
            <div className='connect'>
                <div className='form'>
                    <label>nom</label>
                    <input />
                </div>

                <div>
                    <label>prenom</label>
                    <input />
                </div>

                <button>Se connecter</button>
            </div>
        </>
    );
}

export default Connexion;
